uploadtext:
Файл-влакым пурташлан тиде формым кучылт.
Ондак пуртымо файл-влакым ончаш але кычалашлан [[Special:FileList|list вераҥдыме файл-влак спискыш]] кусно. Вераҥдымаш да угычын вераҥдымаш тыгак [[Special:Log/upload|вераҥдымаш журналыште]] возалтыт. Кораҥдымаш-влак [[Special:Log/delete|кораҥдымаш журналыште]] тыште палемдалтыт.

Файлым велыжыш пурташлан, моло формо коклаште кылверым кучылтса:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> файлын тичмаш версийжым кучылташлан;
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong> "Вуймут ӱлнырак" шола могыр кумдыкышто 200 пиксель лопкытан сӱретым кучылташлан квадрат;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> шке файлжым ончыктыдымо файллан вияш кылверлан.

delete-warning-toobig:
Тиде велыжын пеш кужу вашталтыш историйже ($1 {{PLURAL:$1|версий}} деч шукырак).
Тудым кораҥдымаш «{{SITENAME}}» сайтын данный базыжын пашажым пудыртымашке конден кертеш;
шекланен ыште.

sessionfailure:
Тыге коеш, кызытсе паша сессийыште нелылык лектын;
тиде ыштымашым «сессийым руалтен налме» деч кораҥашлан манын, чарыме.
Порылий, кышкарым угыч колто.
